public class Solution {
    public int AccountBalanceAfterPurchase(int purchaseAmount) {
        // Calculate the rounded purchase amount.
        // We add 5 to make sure that when we divide by 10 and then multiply by 10,
        // we get the nearest upper multiple of 10 for numbers exactly in the middle.
        int roundedPurchaseAmount = (purchaseAmount + 5) / 10 * 10;

        // Calculate and return the remaining balance after the purchase.
        return 100 - roundedPurchaseAmount;
    }
}
